import React from "react";
import { Route, BrowserRouter } from "react-router-dom";
import "./App.css";
import Home from "./components/Home";
import About from "./components/About";
import Products from "./components/Products";
import {  } from "react-bootstrap";


function App() {
  return (
    <div>      

     <BrowserRouter>
     <Route path='/' exact component={Home}/>
     <Route path='/products' exact component={Products}/>
     <Route path='/about' exact component={About}/>
     <Route path='/scarf' exact component={About}/>
     <Route path='/blanket' exact component={About}/>
     <Route path='/beanie' exact component={About}/>
     <Route path='/kandi' exact component={About}/>
     <Route path='/jewelry' exact component={About}/>
     <Route path='/magnet' exact component={About}/>
     <Route path='/coaster' exact component={About}/>
     </BrowserRouter>
    </div>
  );
}

export default App;
